tables.table_schema:
CREATE TABLE quantum_calibration_parameters (
    device_id INT,
    parameter_name VARCHAR(50),
    parameter_value FLOAT,
    timestamp TIMESTAMP
);

CREATE TABLE quantum_devices (
  device_id INT PRIMARY KEY,
  device_name STRING,
  calibration_date DATE,
  calibration_parameters JSONB
);

CREATE TABLE calibration_parameters (
    parameter_id SERIAL PRIMARY KEY,
    parameter_name VARCHAR(50) NOT NULL,
    parameter_description TEXT,
    parameter_unit VARCHAR(20)
);

CREATE TABLE quantum_devices (
   device_id INT PRIMARY KEY,
   device_name VARCHAR(50),
   calibration_date DATE,
   calibration_accuracy DECIMAL(10, 2)
);

CREATE TABLE calibration_parameters (
   parameter_id INT PRIMARY KEY,
   device_id INT,
   parameter_name VARCHAR(50),
   parameter_value DECIMAL(10, 2)
);

CREATE TABLE calibration_reports (
   report_id INT PRIMARY KEY,
   calibration_id INT,
   report_date DATE,
   report_text TEXT
);

CREATE TABLE QuantumDevice (
  device_id UUID PRIMARY KEY,
  device_name VARCHAR(255),
  calibration_date DATE,
  calibration_status VARCHAR(50)
);

CREATE TABLE CalibrationParameters (
  parameter_id SERIAL PRIMARY KEY,
  device_id UUID,
  parameter_name VARCHAR(255),
  parameter_value FLOAT
);

CREATE TABLE CalibrationHistory (
  history_id SERIAL PRIMARY KEY,
  device_id UUID,
  calibration_date DATE,
  calibration_user VARCHAR(100)
);

CREATE TABLE HardwareComponents (
  component_id SERIAL PRIMARY KEY,
  device_id UUID,
  component_name VARCHAR(255),
  component_type VARCHAR(50)
);

CREATE TABLE CalibrationSettings (
  setting_id SERIAL PRIMARY KEY,
  device_id UUID,
  setting_name VARCHAR(255),
  setting_value VARCHAR(255)
);
